webpackJsonp([0x992cb44c26c3],{3420:function(t,a){t.exports={data:{markdownRemark:{html:"<p>今日は映画館に行きました。\n毛呂山のいなげやに映画館があることを初めて知り、びっくりしました。\nさらに、席に座ろうとしたら、友人の S 君、U 君、K 君も来ていてびっくりしました。</p>\n<p>町の映画館だと、こういうこともあるんだなと思いました。</p>\n<p>ただ、そこで誰かに風邪を感染され、午後はかなり最悪でした。</p>",frontmatter:{cover:null,date:"1990-11-18T20:00:00+09:00",strDate:"1990/11/18",title:"日記"}}},pathContext:{path:"/ja/blog/1990/11/18-diary/",langKey:"ja"}}}});
